import React from "react";
import product from "../../data/product";

export default prop => {

    const table = product.map(products => {
        return (
            <table>
                <tr><td>{products.id}</td><td>{products.nome}</td><td>{products.price}</td></tr>
            </table>

        );
    })

    return table
}
